import React from "react";
import dynamic from "next/dynamic";
import { Box } from "@chakra-ui/core";

const Editor = dynamic(() => import("../../components/editor"), {
  ssr: false,
});

const edit = () => {
  return (
    <Box>
      <Box w="75%">
        <h2>nextjs + ckeditor5</h2>
        <Editor />
      </Box>
    </Box>
  );
};

export default edit;
